import React from 'react';
import Sidebar from '../components/Sidebar';
import { Routes, Route, Navigate } from 'react-router-dom';
import ResidentNotices from './resident/ResidentNotices';
import ResidentComplaints from './resident/ResidentComplaints';
import ResidentBookings from './resident/ResidentBookings';
import ResidentVisitors from './resident/ResidentVisitors';
import ResidentFinances from './resident/ResidentFinances';

export default function ResidentDashboard() {
  const links = [
    { to: '/resident', name: 'Dashboard' },
    { to: '/resident/notices', name: 'Notices' },
    { to: '/resident/payments', name: 'Payments' },
    { to: '/resident/complaints', name: 'Complaints' },
    { to: '/resident/bookings', name: 'Facility Booking' },
    { to: '/resident/visitors', name: 'Visitor Management' },
    { to: '/resident/finances', name: 'Society Finances' },
    { to: '/resident/maintenance', name: 'Maintenance Requests' },
  ];

  return (
    <div className="app-layout">
      <Sidebar links={links} />
      <div className="content">
        <Routes>
          <Route path="/" element={<h2>Welcome to Resident Dashboard</h2>} />
          <Route path="notices" element={<ResidentNotices />} />
          <Route path="payments" element={<ResidentPayments />} />
          <Route path="complaints" element={<ResidentComplaints />} />
          <Route path="bookings" element={<ResidentBookings />} />
          <Route path="visitors" element={<ResidentVisitors />} />
          <Route path="finances" element={<ResidentFinances />} />
          <Route path="maintenance" element={<ResidentMaintenance />} />
          <Route path="*" element={<Navigate to="/resident" replace />} />
        </Routes>
      </div>
    </div>
  );
}
